import React from "react";
const formato = ()=> {
return (`
    # formulario



| **Campo** | **Valor**      |

|-----------|----------------|

| texto 1   | ${inputValues.texto1} |

| texto 2   | ${inputValues.texto2} |

| texto 3   | ${inputValues.texto3} |`)

}

export default formato;
